import React from "react";
import ReactDOM from "react-dom";
import Comment from "./Comment";

const App = () => {
	return (
		<div className="ui container comments">
			<Comment author="Sam" timeAgo="Today 1AM" />
			<Comment author="Alex" />
			<Comment author="Jane" />
		</div>
	);
};

ReactDOM.render(<App />, document.querySelector("#root"));
